import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import CardMedia from '@mui/material/CardMedia';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import StarIcon from '@mui/icons-material/Star';
export default function House(props) {
  const itemtitle={
    fontSize:"18px",
    fontWeight : 'bold',
    margin: "20px",
    flexDirection: 'column',
    alignItems: 'center',
    width: '300px',
    overflow : 'hidden',
    textOverflow: 'ellipsis',
    display: '-webkit-box',
    webkitLineClamp: '8',
    webkitBoxOrient: 'vertical'
  }
  const intro={
    fontSize:"18px",
    fontWeight : 'bold',
    marginTop: "20px"
  }
  return (
      <div className=" flex p-3 rounded-lg  hover:shadow-lg ease-linear transition-all  ">
          <div className="flex ">
          <picture className="max-w-[220px]  aspect-square m-2">
              <img
                src={`${props.url}`}
                loading="lazy"
                className="w-full h-full  shadow-lg object-cover"
              />
            </picture>
            <div className="item-title " style={itemtitle}>{props.name}<br></br><LocationOnIcon/>台北市<br></br><StarIcon color="secondary"/>{props.score.toFixed(1)}<br></br>{props.price}</div>
            <div className="item-title " style={itemtitle}>{props.intro}</div>
          </div>

      </div>
  );
}
